import React from 'react';
import Data from '../../Data';
import './PageStyles.css';
const Home = () => {
  return (
    <section className='home'>
        <div className='Container'>
            <h1>Home page</h1>
            <div>
                {Data.map((item) =>(
                    <div>{item.image}</div>
                    ))}
            </div>
        </div>
    </section>
  );
}
export default Home;
